import Axios from "axios";
import { fetchDataPending, fetchDataSuccess, fetchDataError } from "./actions";
const fetchdData = () => {
  return (dispatch) => {
    dispatch(fetchDataPending());
    Axios.get("https://api.jokolodang.com/api/v1/payments")
    //   .then((res) => res.json())
      .then((res) => {
        if (res.error) {
          throw res.error;
        }
        dispatch(fetchDataSuccess(res.products));
        return res.products;
      })
      .catch((error) => {
        dispatch(fetchDataError(error));
      });
  };
};

export default fetchdData;
